import Layout from "../components/Layout/";
import HoverText from "../components/HoverText";
const Skills = () => (
	<Layout>
		<div
			style={{
				height: "100%",
				display: "flex",
				justifyContent: "center",
				color: "white",
			}}
		>
			<HoverText className="h2" string="Under construction" />
		</div>
	</Layout>
);

export default Skills;
